import React, { useState } from 'react'
import styles from "./Main.module.css"
export const Card = () => {
    let img1="data:image/jpeg;base64,"
 let img2="data:image/jpeg;base64,"
 let img3="data:image/jpeg;base64,"

    let img5="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR9SJzAQSIGstdlIJB9TotEhlnjX6ONSjiC_A&usqp=CAU"

    let img6=""
 let imgArr=[img1,img2,img3,img5]
 let[count,setCount]=useState(0)


 const prev = () => {
    if (count === 0) {
      return;
    }
    setCount(count - 1);
  }

  const next = () => {
    if (count === imgArr.length - 1) {
      return;
    }
    setCount(count + 1);
  }

    return (

    <div className={styles.cardDiv}>
          <button  className={styles.buttons} onClick={prev} disabled={count === 0} >prev</button>
      <div className={styles.imgDiv}>
      <img src={imgArr[count]} alt="" />
      </div>
      <button className={styles.buttons} onClick={next} disabled={count === imgArr.length - 1} >next</button>

    </div>
  )
}

